import React, { useEffect,useState } from 'react'


export default function App() {

  return (
    <div
      style={{
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        height: "100vh",
      }}
    >
      <div
        style={{
          width: "130px",
          height: "40px",
          border: "1px solid black",
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
        }}
      >
        {/* <h3>NEXT</h3> */}
        {
          [...Array(100)].map((ele,idx))
        }
      </div>
    </div>
  );
}
